import { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
// material
import {
  Card,
  Table,
  Stack,
  Avatar,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Container,
  Typography,
  TableContainer,
  TablePagination
} from '@mui/material';
// components
import Page from '../components/Page';

export default function Parties() {
  const init = () => {};
  useEffect(() => {
    init();
  }, []);

  return (
    <Page title="Parties - BIZHOPS">
      <Container>
        <Typography variant="h4">All Parties</Typography>
        All your customers and suppliers!
      </Container>
    </Page>
  );
}
